        if (type) {
            var cssClasses = 'mdi mdi-' + type;

            if (vm.canResize) {
                cssClasses += ' canResize';
            }
            if (vm.size) {
                cssClasses += ' md-' + vm.size;
            }
            if (vm.color) {
                cssClasses += ' ' + vm.color;
            }

            return '<i class="' + cssClasses + '"></i>';
        } else {
            return '-';
        }
